import React from 'react'

const DestrucBtn = props => {

    const {word} = props;

    return (
        <div className="btn-contain">
            {toArray(word).map((letter, i) =>{
                return(
                    <span key={i} className='letter'>{letter}</span>
                )
            })}
        </div>
    )
}

export default DestrucBtn;
